import { Fragment } from 'react';
import classes from './PortfolioItem.module.css';

function PortfolioItem(props) {
    return (
        <Fragment>
            <table>
                <tbody>
                    <tr>
                        <td>{props.name}</td>
                        <td>{props.amount}</td>
                        <td>${props.mark}</td>
                    </tr>
                </tbody>
            </table>
        </Fragment>
    )
}

export default PortfolioItem;
